  // deleteActivity: (id: string) => void;
}


export const Kategorite = () => {
  const [sectors, setSectors] = useState<ISector[]>([]);
  return (
    <Container>
      <Fragment>
        {sectors.map((sector) => (
          <Button.Group positive key={sector.sectorId} >
            <Button >{sector.sectorName}</Button>
          </Button.Group>
        ))}
      </Fragment>
    </Container>
  );
};
